import React from "react";
import { Mail, Phone } from "lucide-react";

const HeaderTop = ({ isScrolled }) => {
  return (
    <div className="bg-transparent pt-4" key={isScrolled}>
      <div className="container mx-auto flex sm:justify-center sm:space-x-6 text-sm">
        <div className="flex flex-col sm:flex-row sm:space-x-6 sm:items-center w-full sm:w-auto">
          <a
            href="mailto:projects@nextwebi.com"
            className={`group flex items-center space-x-2 ${isScrolled ? "text-gray-900" : "text-gray-100"} hover:text-blue-400`}
          >
            <Mail className="w-4 h-4 group-hover:text-blue-400" />
            <span>projects@nextwebi.com</span>
          </a>

          <a
            href="tel:+917619635111"
            className={`group flex items-center space-x-2 hover:text-blue-400 ${isScrolled ? "text-gray-900" : "text-gray-100"} mt-2 sm:mt-0`}
          >
            <Phone className="w-4 h-4 group-hover:text-blue-400" />
            <span>+91 76196 35111</span>
          </a>
        </div>
        <div className="flex flex-col sm:flex-row sm:space-x-6 sm:items-center w-full sm:w-auto">
          <a
            href="/"
            className={`group flex items-center space-x-2 ${isScrolled ? "text-gray-900" : "text-gray-100"} hover:text-blue-400`}
          >
             Support
          </a>
          <a
            href="/"
            className={`group flex items-center space-x-2 hover:text-blue-400 ${isScrolled ? "text-gray-900" : "text-gray-100"} mt-2 sm:mt-0`}
          >
            Contact Us
          </a>
        </div>
      </div>
    </div>
  );
};

export default HeaderTop;
